	static float angle = 0.f;
	angle += 0.02f;

	Matrix model_scale = { 0 };
	build_scale_matrix(&model_scale, 0.15f, 0.15f, 0.15f);

	Matrix model_translation = { 0 };
	build_translation_matrix(&model_translation, 0.f, 0.f, 0.f);

	Matrix model_scale_translation = { 0 };
	mul(&model_scale, &model_translation, &model_scale_translation);

	Matrix model_rotation = { 0 };
	build_rotation_matrix(&model_rotation, 0.40825f, 0.40825f, 0.8165f, angle);

